@asos_becky is completely rocking this Le Kilt tee 😍💁 Le Kilt is the latest collaboration and is the brainchild from Samantha McCoach.
Coming from a family who have been creating kilts for the past 40 years. Samantha's grandmother has been a traditional kilt maker in Scotland. She was inspired to start up her own label giving kilts a modern twist 🙌💁💘 Le Kilt was founded in 2014 with a vision of adding a dash of modernity to her family's kilt-making heritage.
The collection is made up of fun prints, textures and kilts (obvs)🌟Samantha made sure to adds lots of pleats to her collection - made using the same techniques she used to watch her granny use when she was young. 👵👧 Find the tee in our bio link or 🔍 Le Kilt on ASOS to cop the ultimate modern kilt twist 👏
